import React from "react";
import Headings from "./Components/Headings";
import Para from "./Components/Para";
import RandomImages from "./Components/RandomImages";



function App() {
    return (
        <>
            <Headings />
            <Para />
            <RandomImages />
            <RandomImages />
            

        </>
    )
};


export default App;
